import React from 'react';
import {Card, Container, Image} from "react-bootstrap";
import {useHistory} from 'react-router-dom';
import {DEVICE_ROUTE} from "../utils/consts";

const DeviceTable = ({device}) => {
    const history = useHistory();
    console.log(device);
    return (
        <Container className="mt-3" onClick={() => history.push(DEVICE_ROUTE + '/' + device.id)}>
            <table className="table">
       
            
                <td>
                <Image width={200} src={process.env.REACT_APP_API_URL + device.img}/>
                </td>
                <td>{device.name}</td>
                <td>{device.brand.name}</td>
                <td>{device.name}</td>
                <td>{device.price}</td>
                <td>{device.rating}</td>
                                
        
    </table>
  </Container>
           
    );
};

export default DeviceTable;
